import React from 'react';
import './App.css';
import { Link, NavLink } from 'react-router-dom';

function Nav() {
    const navStyle = {
        color: 'white'
    };

    return (
        <div className="nav-bar">
            <Nav>
                <Link to="/">
                    Home
                </Link>
                <Link to="/vocab">
                    Vocabulary
                </Link>
                <Link to="/">
                    COMING SOON
                </Link>
                <Link to="/">
                    COMING SOON
                </Link>
            </Nav>
        </div>
    );
}
export default Nav;
